import './App.css';

function Card(props) {
    return (
        <div className='card-blog'>
            <h3>{props.title}</h3>
            <p className='card-blog-text'>{props.description}</p>
            <img src={props.img} alt={props.alt}/>
        </div>
    );
}

export default Card;
